from itertools import combinations

digits = [1, 2, 3, 4, 5, 6, 7, 8, 9]

patterns = []
for i in range(1, len(digits)):
    patterns += [''.join(j) for j in combinations(digits, i)]

unlocks = 0
for pattern in patterns:
    if len(pattern) == len(set(pattern)):
        unlocks += 1

print(unlocks)
